import React from 'react';

class DetailsHost extends React.Component {
    state = {
        id: 0,
    }

    componentDidMount() {
        this.setState({ id: new URLSearchParams(this.props.location.search) });
        this.state.id = parseInt(this.state.id.get("id"));
        console.log(this.state.id);
    }

    render() {
        return(
            <div class="container">
                <h4>Details</h4>
            </div>
        )
    }
}

export default DetailsHost;
